import React, { Component } from 'react';
import logo from './logo.svg';

class Home extends React.Component {
    constructor(props) {
        super(props);
        this.state = {value: ''};

        this.handleChange1 = this.handleChange1.bind(this);
        this.handleChange2 = this.handleChange2.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);
    }
    handleChange1(event) {
        this.setState({value1: event.target.value});
        console.log(event);
    }
    handleChange2(event) {
        this.setState({value2: event.target.value});
        console.log(event);
    }

    handleSubmit(event) {
        alert('A name was submitted: ' + this.state.value1);
        event.preventDefault();
    }
    render() {
        return (
            <div className="container">
                <div className="row">
                    <div className="col-md-4">
                    <form onSubmit={this.handleSubmit}>
                        <label>
                        Value 1:
                        <input type="text" name="value1" value={this.state.value} onChange={this.handleChange1} />
                        </label>
                        <label>
                        Value 2:
                        <input type="text" name="value1"  value={this.state.value} onChange={this.handleChange2} />
                        </label>
                        <input type="submit" value="Add" />
                    </form>
                    </div>
                </div>
            </div>
        );
    }
}

export default Home;
